import ImageUploader from "./ImageUploader";
import React from "react";
import { action } from "@storybook/addon-actions";

export default {
  component: ImageUploader,
  title: "General/ImageUploader"
};

const Template = args => {
  // selectedFiles state
  const [selectedFiles, setSelectedFiles] = React.useState(args.selectedFiles);

  return (
    <ImageUploader
      {...args}
      selectedFiles={selectedFiles}
      onAdd={newFiles => {
        setSelectedFiles(newFiles);

        // fire action
        action("onAdd")(newFiles);
      }}
      onDelete={updatedFiles => {
        setSelectedFiles([]);

        // fire action
        action("onDelete")(updatedFiles);
      }}
    />
  );
};

export const Default = {
  args: {
    dropzoneText: "Drag & drop infographic image or click",
    maxFileSize: 1000000000,
    onAdd: () => {},
    onDelete: () => {},
    selectedFiles: [],
    subText: "A default Model image will be used if no image is uploaded.",
    title: "Model Image"
  },

  render: Template
};

export const WithSingleFileSelected = {
  args: {
    ...Default.args,
    selectedFiles: [
      {
        data: "data:image/png;base64,",
        file: {
          name: "Img_ValidationRoad.png",
          path: "Img_ValidationRoad.png",
          type: "image/png"
        }
      }
    ]
  },

  render: Template
};
